In 16th century Venice, courtesans enjoy unique privileges: dressed richly in red, they read, compose poetry and music, and discuss affairs of state with the men who govern the Republic. When Veronica Franco comes of age, she cannot marry Marco Venier, whom she loves, because she is well born but penniless. Her choice: cloister or courtesan. She steels her heart, and with beauty and intelligence becomes the best. She&amp;#039;s a heroine when she helps convince France to aid Venice in war with Turkey, but when plague descends, the Church charges her with witchcraft. At her inquisition, she must match wits with an old rival, speak for all women, and call courage from Venier
